export class BasicUnit {
    constructor(name, label, phenomenon, system) {
        this.name = "";
        this.label = "";
        this.phenomenon = "";
        this.isValid = false;
        this.system = "unknown";
        if (name && name.length > 0 && label && label.length > 0 && phenomenon && phenomenon.length > 0) {
            this.name = name;
            this.label = label;
            this.phenomenon = phenomenon;
            this.isValid = true;
            if (system)
                this.system = system;
        }
    }
}
